import React from 'react';
import { logo } from './logo.png';

function Header(){
    return(
        <div style={{
            backgroundImage: {logo},
            margin: '50px',
            fontSize: 35,
            paddingLeft: '500px'
        }}>
            Selamat Datang di Sanbercode Todo
        </div>
    );
}

export default Header;
